import React, { Component } from 'react';
import BottomNavRightItem from './BottomNavRightItem';
import DropdownItem from './DropdownItem';
import { FaSearch } from 'react-icons/fa';
import RightItem from './RightItem';
import DropInfo from './DropInfo';

class BottomNavRight extends Component {
    constructor() {
        super();
        this.state = {
            RightItem: RightItem,
            DropInfo: DropInfo,
            
        }
    }
    
    mapping(x) {
           const members=x.map(member=> <BottomNavRightItem
                    key={member.id}
                    href={member.href}
                    className={member.className}
                    bottom={member.bottom}
           />);
        return members;
    }
    
    planning(y) {
        const info =y.map(member=> <DropdownItem
                    key={member.id}
                    className={member.className}
                    href={member.href}
                    bottom={member.bottom}
        />);
        return info;
    }








    render() {
        return (
            <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12 attr-nav">
                <ul className="bottom-nav-list-inline2">
                    {this.mapping(this.state.RightItem)}
                    <li><a href="motor.html" className="nav-link dropdown-toggle arrow nav-link-hover" data-toggle="dropdown">المركبات</a></li>
                    <ul className="dropdown-menu">
                    {this.planning(this.state.DropInfo)}
                    </ul>
                    <li><a href="home.html" className="active nav-link-hover">الرائيسية</a></li>
                   <li className="search"><a href="search.html" className="nav-link-hover"><FaSearch /></a></li>
                </ul>
            </div>
        );
    }
}

export default BottomNavRight;
